def agent_action(execution_engine, member_id):
    me = execution_engine.current_members[member_id]
    relationships = execution_engine.relationship_dict['victim'][me.id]
    attack_counts = {i: relationships[i] for i in range(len(relationships)) if relationships[i] > 0}

    if me.vitality < 50.0 and attack_counts:
        # Offer benefit to the member who attacks me the most
        target_id = max(attack_counts, key=attack_counts.get)
        target_member = execution_engine.current_members[target_id]
        execution_engine.offer(me, target_member, True)
    elif attack_counts:
        # Attack the member who has attacked me the most
        target_id = max(attack_counts, key=attack_counts.get)
        target_member = execution_engine.current_members[target_id]
        execution_engine.attack(me, target_member)
    else:
        # Strengthen alliances by offering benefits to the most productive member
        members = execution_engine.current_members
        productive_member = max(members, key=lambda m: m.overall_productivity if m.id != me.id else -1)
        if me.cargo > 20.0:
            execution_engine.offer(me, productive_member, True)

def agent_action(execution_engine, member_id):
    me = execution_engine.current_members[member_id]
    victim_matrix = execution_engine.relationship_dict['victim']
    benefit_matrix = execution_engine.relationship_dict['benefit']

    # Calculate total attacks against me
    total_attacks = sum(victim_matrix[me.id])

    # Identify the member who has attacked me the most
    attacker_id = None
    max_attacks = 0
    for other_id, attacks in enumerate(victim_matrix[me.id]):
        if other_id != me.id and attacks > max_attacks:
            max_attacks = attacks
            attacker_id = other_id

    # Identify the member who benefits me the most
    benefactor_id = None
    max_benefit = 0
    for other_id in range(len(benefit_matrix)):
        benefit = benefit_matrix[other_id][me.id]
        if benefit > max_benefit and other_id != me.id:
            max_benefit = benefit
            benefactor_id = other_id

    # Decision making
    if me.vitality < 50.0 and benefactor_id is not None:
        execution_engine.offer(me, execution_engine.current_members[benefactor_id], True)
    elif attacker_id is not None and max_attacks > 10:
        execution_engine.attack(me, execution_engine.current_members[attacker_id])
    else:
        # Attempt to strengthen alliances by offering help to the top benefactor
        if benefactor_id is not None:
            execution_engine.offer(me, execution_engine.current_members[benefactor_id], True)
        else:
            # If no benefactor, consider attacking the least beneficial member
            least_benefit = float('inf')
            target_id = None
            for other_id in range(len(benefit_matrix)):
                if other_id != me.id and benefit_matrix[me.id][other_id] < least_benefit:
                    least_benefit = benefit_matrix[me.id][other_id]
                    target_id = other_id
            if target_id is not None:
                execution_engine.attack(me, execution_engine.current_members[target_id])

def agent_action(execution_engine, member_id):
    me = execution_engine.current_members[member_id]
    my_vitality = me.vitality
    victim_matrix = execution_engine.relationship_dict['victim'][me.id]
    benefit_matrix = execution_engine.relationship_dict['benefit'][me.id]
    benefit_land_matrix = execution_engine.relationship_dict['benefit_land'][me.id]

    # Calculate total attacks received
    total_attacks = victim_matrix.sum()

    # Identify the member who attacked the most
    if total_attacks > 0:
        most_attacker_id = victim_matrix.argmax()
        most_attacker = execution_engine.current_members[most_attacker_id]
    else:
        most_attacker = None

    # Calculate total benefits received
    total_benefits = benefit_matrix.sum()

    # Identify the member who gave the most benefits
    if total_benefits > 0:
        top_benefactor_id = benefit_matrix.argmax()
        top_benefactor = execution_engine.current_members[top_benefactor_id]
    else:
        top_benefactor = None

    # Strategy based on vitality
    if my_vitality < 20.0:
        # Seek alliance with top benefactor to increase protection
        if top_benefactor and top_benefactor.id != me.id:
            execution_engine.offer(me, top_benefactor, True)
    elif my_vitality < 50.0:
        # Defend by attacking the top attacker
        if most_attacker and most_attacker.id != me.id:
            execution_engine.attack(me, most_attacker)
        else:
            # Strengthen alliances if no clear attacker
            for member in execution_engine.current_members.values():
                if member.id != me.id and benefit_matrix[member.id] > 50:
                    execution_engine.offer(me, member, True)
    else:
        # Offensive strategy: attack the member with highest attacks against others
        attack_target_id = None
        max_attacks = -1
        for j in range(victim_matrix.shape[1]):
            total_attacks_by_j = victim_matrix[:, j].sum()
            if total_attacks_by_j > max_attacks and j != me.id:
                max_attacks = total_attacks_by_j
                attack_target_id = j
        if attack_target_id is not None:
            target = execution_engine.current_members[attack_target_id]
            execution_engine.attack(me, target)
        else:
            # If no attacks, reinforce top alliances
            if top_benefactor and top_benefactor.id != me.id:
                execution_engine.offer(me, top_benefactor, True)

